  summary: "\n<p>Represents a media type used in a Content-Type header as defined in the RFC 2616.</p>\n"
  remarks: "\n<p>The <xref href=\"System.Net.Http.Headers.MediaTypeHeaderValue\" data-throw-if-not-resolved=\"false\"></xref> class provides support for the media type used in a Content-Type header as defined in <see href=\"http://go.microsoft.com/fwlink/?LinkID=241642\">RFC 2616</see> by the IETF.</p>\n<p>An example of a media-type would be \"text/plain; charset=iso-8859-5.</p>\n"
